export class Utils
{
  public static makeDate(input: string): Date
  {
    input = input.substring(0, input.length - 2);
    // return new Date(input); //TODO: this doesn't work right
    const date: Date = new Date();

    // let d = '12-07-2016';
    let d: string[] = input.split("-");
    let f = new Date(Number(d[2]), Number(d[0]) - 1, Number(d[1]));
    return f;
  }
}
